script: |
  super -f text -I q5476.spq | sort > q5476.out

inputs:
  - name: q5476.spq
    data: |
      SELECT - col0 / - col2 + ( col2 * + col0 + + 60 * - ( - cor0.col1 ) ) AS col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q5476.out
    data: |
      12759
      5890
      5952
